  [],\n\t\"revision_timestamp\": \"2016-07-27T22:49:53.044427\",\n\t\"name\": \"ravalli-national-wildlife-refuge-narrative-report-1964\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ravalli
  National Wildlife Refuge outlines Refuge accomplishments during the 1964 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  raptors, fish, reptiles, and diseases- is also covered. The Refuge development and
  maintenance section discusses physical developments. Resource management is outlined;
  topics include grazing, haying, fur harvesting, and timber removal. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  and hunting. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
